// }

const Navbar = () => {
return <nav className= {classes.nav}>

      <div className= {classes.item}>
      <div>
      <a>Profile</a> 
      </div>
      <div>
        <a>Message</a>
      </div>
      </div>
      <div>
        <a>My calendar</a>
      </div>
      <div>
        <a>Music</a>
      </div>
      <div>
        <a>Settings</a>
      </div>

    </nav>
}
export default Navbar;
